Super excited to share my Men’s Grooming tutorial, with Asiana TV, (@asianatv) the new online channel covering a variety of content on the UK Asian Fashion Industry. 
Having been in the Fashion & Beauty industry for over a decade and worked with some amazing creatives worldwide, I’ve adapted a work style that is straight to the point yet effective. Hope you enjoy this as much as I did creating it with an amazing team! ⁣
Filmed by: @kushimedia ⁣

